window.bookSummaryJSON = "<p><b>The big enemy is down. Things seem like they are going better than ever for Rob and Yonderton. If only...</b></p> <p>There are threats beyond mere gangs; enemies who don't simply want to control but want nothing more than to kill Rob and everything he has come to love.</p> <p>As Rob's attention is focused on bettering his town, he will have to face treachery, monsters, and questions of the heart.</p> <p>Luckily, he doesn't have to do it alone. He has his deputies and clerks to stand beside him as well as hidden allies he barely understands.</p> <p>This book will bring a conclusion to the first story arc of Rob's adventures in Olimero.</p>"; 
